import '../assets/PantallaLogin.css';
import 'bootstrap/dist/css/bootstrap.min.css';

class DatosImportantes extends Component
{
    render()
    {
        return(
            <div className = "contenedorImportanteExtra">
                <div className="row">
                    <div className="col-6">
                        <p className="textDescripcionDatosImport">{this.props.descrip}</p>
                    </div>
                    <div className="col-4">
                        <p className = "textDescripcionValoresImport">{this.props.valor}</p>
                    </div>
                </div>                
            </div>
        );
    }
}
export default DatosImportantes;
